import React from "react";

const MasonryItem = () => {
  const ChangeStyle = e => {
    e.currentTarget.style.height = "500px";
  };
  return (
    <div
      onClick={ChangeStyle}
      className='masonry-item'
      style={{ height: "200px" }}
    ></div>
  );
};

export default MasonryItem;
